Had such an incredible trip to St. Croix to celebrate our good friends Dave & Jackie tying the knot! They were married at their beautiful home, Coakley Bay Estate, and words can’t describe how amazing their wedding was and all of the events surrounding it! Michael Bolton performing was just a small bonus. 😉 
Congratulations Dave and Jackie!! We love you guys! 😘
